INSERT INTO `Lecturer` VALUES (1,'Αδαμίδης Παναγιώτης','Ο κ. Π. Αδαμίδης είναι καθηγητής του Τμήματος Μηχανικών Πληροφορικής και Ηλεκτρονικών Συστημάτων της Σχολής Μηχανικών του Διεθνούς Πανεπιστημίου της Ελλάδος (ΔΙ.ΠΑ.Ε.). Επίσης ήταν μέλος της Διοικούσας Επιτροπής του ΔΙ.ΠΑ.Ε από Ιούν 2019 έως Φεβ. 2020.\nΔιετέλεσε Καθηγητής του Τμήματος Μηχανικών Πληροφορικής, του Αλεξάνδρειου ΤΕΙ Θεσσαλονίκης μεταξύ 1999-2019 καθώς και Πρόεδρος του Τμήματος 2008-2010.\nΉταν Αντιπρύτανης Διοικητικών Υποθέσεων Ακαδημαϊκών Υποθέσεων και Φοιτητικής Μέριμνας από Δεκ. 2017 έως Μάιο 2019 και μέλος του Συμβουλίου του ΑΤΕΙΘ από Σεπτ. 2016 έως Ιούλιο 2017.','website','email'),(2,'Αντωνίου Ευστάθιος','Ο Ευστάθιος Αντωνίου έλαβε το πτυχίο των Μαθηματικών το 1994 και το διδακτορικό του δίπλωμα στη Μαθηματική Θεωρία Συστημάτων το 2000, από το τμήμα Μαθηματικών του ΑΠΘ. Την δεκαετία 2000-10 εργάστηκε ως μεταδιδακτορικός ερευνητής σε προγράμματα στην περιοχή της Ανάλυσης και Σχεδίασης Συστημάτων Ελέγχου με τη βοήθεια Η/Υ. Κατά την περίοδο 2002-08 εργάστηκε ως επιστημονικός συνεργάτης στο ΓΤΘΕ του ΑΤΕΙΘ, ως επίκουρος καθηγητής του ΠΔ 407/80 στο τμήμα Μαθηματικών του ΑΠΘ για το ακαδημαϊκό έτος 2005-6 και ως επισκέπτης Επίκουρος Καθηγητής της κατεύθυνσης Θεωρητικής Πληροφορικής και Θεωρίας Συστημάτων & Ελέγχου του Προγράμματος Μεταπτυχιακών Σπουδών του ίδιου τμήματος κατά το έτος 2010-11. Παράλληλα, κατά τα ακαδημαϊκά έτη 2004-14 και 2019-2022 υπηρέτησε ως μέλος Συνεργαζόμενου Εκπαιδευτικού Προσωπικού για την θεματική ενότητα «Διακριτά Μαθηματικά και Μαθηματική Λογική» του προγράμματος σπουδών Πληροφορικής του ΕΑΠ','www.antoniou.gr','antoniou@ihu.gr'),(3,'Βίτσας Βασίλης','Καθηγητής Τομέας Συστημάτων και Τεχνολογίας Υπολογιστών','www.vitsas.gr','vitsas@ihu.gr'),(4,'Δέρβος Δημήτριος','Βασικές σπουδές: πτυχιούχος Φυσικής, Αριστοτέλειο Πανεπιστήμιο Θεσσαλονίκης (1979). Μεταπτυχιακές σπουδές: ΜΑ Φυσικής, Πανεπιστήμιο της Νότιας Καλιφόρνιας, Λος Άντζελες, Η.Π.Α. (1982), MSc Μηχανικού Υπολογιστών, Πανεπιστήμιο της Νότιας Καλιφόρνιας, Λος Άντζελες, Η.Π.Α. (1982). Διδάκτορας του Τμήματος Επιστήμης των Υπολογιστών, Αριστοτέλειο Πανεπιστήμιο Θεσσαλονίκης (2000, τίτλος διδακτορικής διατριβής: Σχήματα Δυαδικών Υπογραφών σε Βάσεις Κειμένων). Αποδέκτης της διεθνούς διάκρισης ISI/ASIS&T Citation Analysis Research Grant (Ετήσια Διάσκεψη ASIS&T, Σάρλοτ, Βόρεια Καρολίνα, Η.Π.Α., Νοέμβριος 2005).','www.dad.gr','dad@ihu.gr'),(5,'Διαμαντάρας Κωνσταντίνος','Ο Δρ. Κωνσταντίνος Διαμαντάρας έχει βασικό πτυχίο Ηλεκτρολόγου Μηχανικού από το ΕΜΠ και Διδακτορικό Δίπλωμα από το Τμήμα Ηλεκτρολόγων Μηχανικών του Πανεπιστημίου Princeton των ΗΠΑ το 1992. Κατόπιν εργάστηκε ως μεταδιδακτορικός ερευνητής στην εταιρία Siemens Corporate Research στο Princeton, των ΗΠΑ καθώς και στο Τμήμα Ηλεκτρολόγων Μηχανικών και Μηχ. Η/Υ του ΑΠΘ. Από το 1998, είναι μέλος Ε.Π. του Τμήματος Πληροφορικής του ΤΕΙ Θεσσαλονίκης όπου από το 2006 κατέχει την θέση του τακτικού Καθηγητή. Στα ερευνητικά του ενδιαφέροντα περιλαμβάνονται η μηχανική μάθηση, η επεξεργασία σήματος, η παράλληλη επεξεργασία, και η επεξεργασία εικόνας και βίντεο.','www.diamanti.gr','diamanti@ihu.gr'),(6,'Μαρμόρκος Ιωάννης','Ιωάννης Μαρμόρκος, Καθηγητής Τμήμα Μηχανικών Πληροφορικής και Ηλεκτρονικών Συστημάτων, ΔΙ.ΠΑ.Ε\nΟ Ιωάννης Μαρμόρκος είναι πτυχιούχος του Τμήματος Φυσικής του ΑΠΘ και κάτοχος μεταπτυχιακού (M.Sc.) και διδακτορικού (Ph.D.) διπλώματος από το University of Maryland at College Park (ΗΠΑ). Εχει εργαστεί ως μεταδιδακτορικός ερευνητής στο πανεπιστήμιο του Leiden (Lorentz Ιnstitute) της Ολλανδίας, τσο Πανεπιστήμίο της Αμβέρσας στο Βέλγιο και στο Πανεπιστήμιο της Οξφόρδης (UK). Εχει εργαστεί επίσης ως επισκέπτης καθηγητής στο Πανεπιστήμιο του Μπέρμιγχαμ (UK), ως επισκέπτης ερευνητής στο Thomas Watson Research Center της IBM στο Yorktown Heights της Νέας Υόρκης και ως εξειδικευμένος Μηχανικός με αντικείμενο τα Δίκτυα Οπτικών Ινών στον ΟΤΕ ','www.marmokos.gr','marmokos@ihu.gr'),(7,'Σαλαμπάσης Μιχάλης','Ο Μιχάλης Σαλαμπάσης έχει πτυχίο πληροφορικής και διδακτορικό στην Πληροφορική. Βασικά ερευνητικά του ενδιαφέροντα είναι η ανάκτηση πληροφοριών, προηγμένα συστήματα εξερευνητικής αναζήτησης, έξυπνη διαχείρισης πληροφορίας, σχεδίαση & αξιολόγηση διαδραστικών συστημάτων. Επίσης έχει ασχοληθεί ιδιαίτερα με μεθοδολογίες πειραματικής αξιολόγησης της αποτελεσματικότητας αναζήτησης σε ψηφιακές βιβλιοθήκες. Υπήρξε επισκέπτης ερευνητής στο ερευνητικό ινστιτούτο Information Retrieval Facility (www.ir-facility.org), καθώς επίσης και στο Πολυτεχνείο της Βιέννης (Marie Curie Fellow) όπου εργάστηκε στην αναζήτηση πληροφοριών σε μεγάλης κλίμακας βιβλιοθήκες από πατέντες.','www.salampasis.gr','salampasis@ihu.gr'),(8,'Γουλιάνας Κωνσταντίνος','Ο Κωνσταντίνος Γουλιάνας υπηρετεί ως Αναπληρωτής Καθηγητής του τμήματος Μηχανικών Πληροφορικής και Ηλεκτρονικών Συστημάτων στο Διεθνές Πανεπιστήμιο της Ελλάδος με γνωστικό αντικείμενο “Προγραμματισμός Επιστημονικών Εφαρμογών και Αριθμητική Ανάλυση – Νευρωνικά Δίκτυα”. Έλαβε το βασικό του πτυχίο στα Μαθηματικά από το Τμήμα Μαθηματικών της Φυσικομαθηματικής Σχολής του Πανεπιστημίου Ιωαννίνων το 1982, το μεταπτυχιακό του δίπλωμα στην Επιστήμη της Πληροφορικής (Master of Science in Computer Science) το 1987 από το Illinois Institute of Technology (IIT), USA και το Διδακτορικό του το 2000 στην περιοχή των Τεχνητών Νευρωνικών Δικτύων ( εφαρμογές σε προβλήματα Αριθμητικής Ανάλυσης ) από το Τμήμα Εφαρμοσμένης Πληροφορικής του Πανεπιστημίου Μακεδονίας.','www.goul.gr','goul@ihu.gr'),(9,'Παπακώστας Δημήτριος','Υπηρετεί ως Καθηγητής του τμήματος Μηχανικών Πληροφορικής και Ηλεκτρονικών Συστημάτων στο Διεθνές Πανεπιστήμιο της Ελλάδος με γνωστικό αντικείμενο ‘Αναλογικά και Ψηφιακά Συστήματα Ηλεκτρονικών’ και είναι διπλωματούχος Ηλεκτρολόγος Μηχανικός του Α.Π.Θ. (1991) και Διδάκτορας του ίδιου ιδρύματος (1999) με αντικείμενο διατριβής σχετικό με τη διάγνωση βλαβών ηλεκτρονικών κυκλωμάτων. Έχει συμμετάσχει, ως επιστημονικά υπεύθυνος και ως βασικός και μεταδιδακτορικός ερευνητής σε ερευνητικά προγράμματα για περισσότερα από 20 έτη. Έχει δημοσιεύσει περισσότερα από 60 επιστημονικά άρθρα σε διεθνή περιοδικά και πρακτικά συνεδρίων ενώ έχουν βρεθεί περισσότερες από 300 αναφορές άλλων ερευνητών σε αυτές τις δημοσιεύσεις. Είναι κριτής σε διεθνή επιστημονικά περιοδικά και συνέδρια. Τα ερευνητικά του ενδιαφέροντα επικεντρώνονται στην ανάλυση, σχεδίαση και διάγνωση βλαβών ηλεκτρονικών κυκλωμάτων και συστημάτων.','www.papkost.gr','papkost@ihu.gr');
